#include<iostream>
#include<fstream>

using namespace std;

ifstream fin("cifre.in");
ofstream fout("cifre.out");

int main()
{
    long long n, c, x, y, ans = 0, p = 1;
    fin >> n >> c;
    while(n)
    {
        y = n % 10;
        n /= 10;
        x = n % 10;
        if(y == c)
        {
            ans += n * p + min(x + 1, c);
        }
        if(x == c)
        {
            ans += n * p + y + 1;
        }
        p *= 10;
    }
    fout << ans;
    return 0;
}
